// CategoryList.js
import React from 'react';
import { Link } from 'react-router-dom';
import { categories } from './CategoryData';

function CategoryList() {
  return (
    <div>
      <h4>대학교 공부정리(B/1-1)</h4>
      {categories.map((category, index) => (
        <div key={index}>
          <h3>{category.name}</h3>
          {category.posts.map((opt, optIndex) => (
            <Link
              key={optIndex}
              to={
                opt.type === 'folder'
                  ? `/blog/${category.name}/${opt.name}`
                  : `/blog/${category.name}/${opt.name}/file`
              }
            >
              <a>{opt.name}</a>
              <br />
            </Link>
          ))}
        </div>
      ))}
    </div>
  );
}

export default CategoryList;
